}
function App() {

  return (
    <>
    <nav>
    <div id="logo">
      <img src="./images/logo.jpg" alt="logo.png" style={myStyle} />
    </div>
    <ul>
      <li>Home</li>
      <li>About</li>
      <li>Services</li>
      <li>Contact</li>
      <li>News</li>
